    [],nt"revision_timestamp": "2015-08-21T22:39:14.805192",nt"name": "functional-status-and-outcome-database-fsod",nt"isopen":
    true,nt"url": null,nt"notes": "The Functional Status and Outcome Database
    (FSOD) captures and tracks information about patient rehabilitative care throughout
    the VA. FSOD supports the entry of information from acute and sub-acute inpatient
    rehabilitation programs, as well as a broad range of outpatient rehabilitation programs.
    Outcome-based information including length of stay and cost is also tracked. Participating
    Veterans Affairs Medical Center staff enter information into FSOD on-line through
    a software program called VA FIMware (Functional Independence Measurement (FIM)).
    Users throughout the VA can access stored FSOD data through VA FIMware. Quarterly,
    FSOD data is transferred electronically to the Uniform Data System for Medical Rehabilitation
    (UDSmr) server in Buffalo, New York. The UDSmr database contains a U.S. national
    roll-up of rehabilitative programs. Users include all VA personnel involved in rehabilitative
    care and the UDSmr.",nt"license_title": "Creative Commons CCZero",nt"extras":
